import React, { Component } from 'react';
import Typography from '@material-ui/core/Typography';
import { withStyles } from '@material-ui/core/styles';
import Link from 'next/link';
import { connect } from "react-redux"; 
import PropTypes from 'prop-types';
// NavBar Drawer
import IconButton from '@material-ui/core/IconButton';
import SwipeableDrawer from '@material-ui/core/SwipeableDrawer';
import Divider from '@material-ui/core/Divider';
import MenuIcon from '@material-ui/icons/Menu';
import ListItemText from '@material-ui/core/ListItemText';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';

const styles = (theme) =>({
   grow:{
    flexGrow: 1,
   },
   navLinks: {
    display: 'none',
    [theme.breakpoints.up('md')]: {
      display: 'flex',
    },
    justifyContent:"space-around",
    width:"54%"
  },
})

export class NavLinks extends Component {
        state={
                anchor:false
            }
        
           handleOpen = () =>{
            this.setState({
                anchor:true
            })
           }
            handleClose = () =>{
                this.setState({
                    anchor:false
                })
            }
          toggleDrawer = (event) => {
                if (event && event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
                  return;
                }
                this.setState({
                    anchor:true
                })
            }
    render() {
        const {classes} = this.props
        const link = [
          {
            id:"1",
            Name:"Blog",
            href:"/blog",
            // url:"/blog"
          },
          {
            id:"2",
            Name:"Contact Us",
            href:"/ContactUs",
            // url:"/ContactUs"
          }
        ]
        return (         
                <>
                 <div className={classes.navLinks}>
                   {
                     link.map((links) =>(
                       <Link key={links.id}  href={links.href}>
                         <a>
                         <Typography key={links.id} className="navBarLinks"  variant="body1" color="inherit" noWrap>
                          {links.Name}
                          </Typography> 
                        </a>   
                       </Link>
                     ))
                   }        
          {/* <button onClick={darkModes}>DarkMode</button> */}         
                 </div>
                 <IconButton onClick={this.handleOpen} className="MenuButton"><MenuIcon/></IconButton>
                 <SwipeableDrawer
            anchor="left"
            className="NavDrawer"
            open={this.state.anchor}
            onClose={this.handleClose}
            onOpen={this.handleOpen}>
                     <div             
              role="presentation"
              className={classes.List}            
            >
                    <List>
                      {
                        link.map((links) =>(
                          <Link key={links.id} href={links.href}>
                           <a>
                           <ListItem key={links.id} button  onClick={this.handleClose}>
                            <ListItemText primary={links.Name}/>
                            </ListItem>
                            <Divider/>
                           </a>
                          </Link>
                        ))
                      }                   
                    </List>
            </div>
            </SwipeableDrawer>
           
          </>
        )
    }
}
NavLinks.propTypes = {
    classes: PropTypes.object.isRequired,
  };

export default connect(mapStateToProps)(withStyles(styles)(NavLinks))
